function showSearchProfiles(profiles) {
  let inptComponent = document.querySelector("#search-input");
  return (
    <div>
      <div>
        <span className="h5 go-to-profile">{values.user.username}</span>

        <img
          src={values.picture}
          alt="s"
          className="profile-img-comment rounded-circle go-to-profile"
        />
      </div>
    </div>
  );
}

export { showSearchProfiles };
